router.get('/appTracker', function (req, res) {
	var count = 0;
	var pType = [];
	var purposeTArray = [];
	var purposeType;
	var purpose_string = "";
	models.Application.find({
		where: {
			user_id: req.user.id,
		}
	}).then(function (data) {
		models.Institution_details.findAll({
			where: {
				app_id: data.id,
			},
			attributes: ['type']
		}).then(function (i_details) {

			for (var i = 0; i < i_details.length; i++) {
				if (i_details[i] != null || i_details[i] != '' || i_details[i] != undefined) {
					purposeType = i_details[i].type;
					if (i == 0) {
						purpose_string = purposeType
					} else if (i > 0) {
						purpose_string = purpose_string + "," + purposeType
					}
					purposeTArray.push(purposeType)
				}
				count++;
			}
			pType.push(purpose_string);


		})
		setTimeout(() => {
			var wesItemFlag = false;
			var wesType = ['Educational credential evaluators WES']
			purposeTArray.forEach(function (item) {
				if (wesType.indexOf(item) !== -1) {
					wesItemFlag = true;
				}

			});
			return res.json({
				status: 200,
				data: data,
				wesItemFlag: wesItemFlag,
				purpose: pType,
			});
		}, 1000)

	});
});


router.get('/profileValue', middlewares.getUserInfo, function (req, res) {
	var view_data = {};
	models.User.find({
		where: {
			id: req.user_id
		}
	}).then(function (user_Profile_Values) {
		models.Orders.findAll({
			where: {
				user_id: req.User.id,
				status: '1'
			}
		}).then(function (orders) {
			if (orders.length >= 1) {
				view_data.amount_paid = true;
			} else {
				view_data.amount_paid = false;
			}
			view_data.profile = user_Profile_Values;
			return res.json({
				message: 'Successfully retrieved data !',
				status: 200,
				data: view_data
			});
		})
	});
});


router.post('/updateProfile', middlewares.getUserInfo, function (req, res) {
	var body_data = req.body.data;
	var username = body_data.username;
	var surname = body_data.surname;
	var gender = body_data.gender;
	//var dob = body_data.dob;
	var country = body_data.country;
	var mobile_country_code = body_data.phone_code;
	var phone = body_data.phone;
	var postal_code = body_data.postal_code;
	var city = body_data.city;
	var address = body_data.address;
	var whatsappCountryCode = body_data.whatsappCountryCode;
	var whatsappMobile = body_data.whatsappMobile;


	models.User.find({
		where: {
			id: req.User.id,
		}
	}).then(function (user_profile) {
		if (user_profile) {
			user_profile.update({
				name: username,
				surname: surname,
				mobile: phone,
				gender: gender,
				city: city,
				//dob: dob,
				mobile_country_code: mobile_country_code,
				postal_code: postal_code,
				country_id: country,
				address: body_data.address,
				what_mobile_country_code: whatsappCountryCode,
				what_mobile: whatsappMobile,
			}).then(function (updated_profile) {
				res.json({
					status: 200,
					message: 'Successfull in updating Profile details'
				});
			})
		} else {
			console.error("error in console")
		}
	});
});

