router.get('/getApp_details', middlewares.getUserInfo, function (req, res) {
	var user_id = req.User.id;
	var purposeType;
	var purposeArray = [];
	var purpose_string = "";
	var data = {};
	var acknowledgeFlag;
	var count = 0;
	models.Application.findAll({
		where: {
			user_id: req.User.id,
		}
	}).then(got => {
		var length = got.length;
		if (length > 0) {
			got.forEach(element => {
				models.Iptracker.findAll({
					where: {
						app_id: element.id
					}
				}).then(track => {
					var trackLength = track.length; if (track.length > 0) {
						acknowledgeFlag = true;
					}
				})

				models.Institution_details.findAll({
					where: {
						app_id: element.id,
					},
					attributes: ['type']
				}).then(function (i_dtails) {

					var detailLength = i_dtails.length;
					for (var i = 0; i < i_dtails.length; i++) {
						if (i_dtails[i] != null || i_dtails[i] != '' || i_dtails[i] != undefined) {
							purposeType = i_dtails[i].type;
							if (i == 0) {
								purpose_string = purposeType
							} else if (i > 0) {
								purpose_string = purpose_string + "," + purposeType
							}

						}
						count++;
					}
					purposeArray.push(purpose_string);
				})

			})


		}

		data = got;

		setTimeout(() => {

			return res.json({
				status: 200,
				length: length,
				acknowledgeFlag: acknowledgeFlag,
				purposeArray: purposeArray,
				data: data
			});
		}, 3500)
	})
})

router.get('/getApplicationDetails', middlewares.getUserInfo, function (req, res) {
	console.log("/getApplicationDetails");
	var user_id = req.User.id;
	var data = [];
	models.Application.findAll({
		where: {
			user_id: user_id
		}
	}).then(function (applications) {
		if (applications.length > 0) {
			applications.forEach(application => {
				models.Institution_details.findAll({
					where: {
						app_id: application.id
					}
				}).then(function (institutions) {
					institutions.forEach(institute => {
						if (institute.type == 'Educational credential evaluators WES' && application.tracker == 'signed') {
							models.Wes_Records.findAll({
								where: {
									userId: user_id,
									appl_id: application.id
								}
							}).then(function (wesRecords) {
								if (wesRecords.length > 0) {
									data.push({
										id: application.id,
										purpose: institute.type,
										status: 'done',
										notes: application.notes
									})
								} else {
									data.push({
										id: application.id,
										purpose: institute.type,
										status: application.tracker,
										notes: application.notes
									})
								}
							})
						} else {
							models.EmailActivityTracker.find({
								where: {
									email: institute.email,
									subject: 'Official Record of  ' + req.User.name + ' ' + req.User.surname
								}
							}).then(function (emailActivity) {
								if (emailActivity) {
									data.push({
										id: application.id,
										purpose: institute.type,
										status: emailActivity.status,
										notes: application.notes
									})
								} else {
									data.push({
										id: application.id,
										purpose: institute.type,
										status: application.tracker,
										notes: application.notes
									})
								}
							})
						}
					})
				})
			})
			setTimeout(() => {
				res.json({
					status: 200,
					data: data
				})
			}, 1500)
		} else {
			res.json({
				status: 400,
				message: 'Not Applied Yet'
			})
		}
	})
})

