router.post('/deleteTranscripts', middlewares.getUserInfo, function (req, res) {

	var userData = req.body.data
	models.User_Transcript.find({
		where: {
			id: userData.userTranscriptId
		}
	}).then(function (userTranscript) {
		if (userTranscript) {
			var path = userData.fileName
			//require('fs').unlink(path, function(err) {
			userTranscript.destroy().then(function (deltranscript) {
				// czonsole.log("deltranscript=="+JSON.stringify(deltranscript))
				if (deltranscript) {
					res.json({
						status: 200,
						message: "transcript deleted Successfully"
					})

				} else {
					res.json({
						status: 400,
						message: "transcript not delete"
					})
				}
			})
			//})
		}
	})
})

router.post('/deleteErrataTranscript', middlewares.getUserInfo, function (req, res) {

	var userData = req.body.data
	models.User_Transcript.find({
		where: {
			id: userData.id
		}
	}).then(function (userTranscript) {
		if (userTranscript) {
			var path = userData.file_path
			//require('fs').unlink(path, function(err) {
			userTranscript.destroy().then(function (deltranscript) {
				// czonsole.log("deltranscript=="+JSON.stringify(deltranscript))
				if (deltranscript) {
					models.Activitytracker.create({
						user_id: userData.user_id,
						activity: deltranscript.name + ' Deleted',
						data: deltranscript.file_name + ' deleted by ' + req.User.email,
						applicaiton_id: userData.app_id
					})
					res.json({
						status: 200,
						message: "transcript deleted Successfully"
					})

				} else {
					res.json({
						status: 400,
						message: "transcript not delete"
					})
				}
			})
			//})
		}
	})
});

