router.get('/getuploadedCurriculum', middlewares.getUserInfo, function (req, res) {
	var curriculumInfos = [];
	var counts = 0
	models.User_Curriculum.findAll({
		where: {
			user_id: req.User.id,
		}
	}).then(curriculums => {

		if (curriculums.length > 0) {
			curriculums.forEach(curriculum => {
				filenamee = constant.BASE_URL + "/upload/curriculum/" + req.User.id + "/" + curriculum.file_name
				TranscriptId = curriculum.id,
					transcriptNamee = curriculum.name
				models.College.find({
					where: {
						id: curriculum.collegeId
					}
				}).then(clgdata => {
					curriculumInfos.push({
						user_id: curriculum.user_id,
						collegeId: curriculum.collegeId,
						collegeName: clgdata.name,
						fileName: filenamee ? filenamee : '',
						curriculumId: curriculum.id,
						curriculum_name: curriculum.file_name ? curriculum.file_name : '',
						lock_transcript: curriculum.lock_transcript
					})
					counts++
					if (curriculumInfos.length === counts) {
						res.send({
							status: 200,
							data: curriculumInfos
						})
					}

				});
			})

		} else {
			res.json({
				status: 400,
				data: curriculumInfos
			})
		}
	})
})

